BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Message" (
	"messageID"	INTEGER NOT NULL,
	"sender"	TEXT NOT NULL,
	"receiver"	TEXT NOT NULL,
	"time"	NUMERIC,
	"message"	TEXT NOT NULL,
	FOREIGN KEY("sender") REFERENCES "User"("username"),
	FOREIGN KEY("receiver") REFERENCES "User"("username"),
	PRIMARY KEY("messageID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "School" (
	"schoolID"	INTEGER NOT NULL,
	"name"	TEXT NOT NULL,
	PRIMARY KEY("schoolID")
);
CREATE TABLE IF NOT EXISTS "Rating" (
	"raterID"	TEXT NOT NULL,
	"listingID"	INTEGER NOT NULL,
	"rating"	INTEGER NOT NULL CHECK("rating" = 1 OR "rating" = 2 OR "rating" = 3 OR "rating" = 4 OR "rating" = 5),
	FOREIGN KEY("raterID") REFERENCES "User"("username"),
	FOREIGN KEY("listingID") REFERENCES "Listing"("listingID")
);
CREATE TABLE IF NOT EXISTS "Listing" (
	"listingID"	INTEGER NOT NULL,
	"location"	TEXT NOT NULL,
	"openingDate"	TEXT,
	"size"	INTEGER,
	"unitType"	TEXT NOT NULL CHECK("unitType" = "dorm" OR "unitType" = "apartment"),
	"offer"	NUMERIC,
	"description"	TEXT,
	"leaseInMonths"	INTEGER,
	"available"	TEXT NOT NULL,
	"authorID"	INTEGER NOT NULL,
	PRIMARY KEY("listingID")
);
CREATE TABLE IF NOT EXISTS "User" (
	"username"	TEXT NOT NULL UNIQUE,
	"password"	TEXT NOT NULL,
	PRIMARY KEY("username")
);
CREATE TABLE IF NOT EXISTS "Owner" (
	"username"	TEXT NOT NULL,
	"firstName"	TEXT NOT NULL,
	"lastName"	TEXT NOT NULL,
	"authorID"	INTEGER NOT NULL,
	FOREIGN KEY("username") REFERENCES "User"("username"),
	PRIMARY KEY("authorID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Student" (
	"username"	TEXT NOT NULL,
	"firstName"	TEXT NOT NULL,
	"lastName"	TEXT NOT NULL,
	"schoolID"	INTEGER NOT NULL,
	"semester"	TEXT NOT NULL CHECK("semester" = "fall" OR "semester" = "winter" OR "semester" = "spring" OR "semester" = "summer"),
	"year"	INTEGER NOT NULL,
	"budget"	NUMERIC,
	FOREIGN KEY("username") REFERENCES "User"("username")
);
